-- ----------------------------
-- Table structure for users
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '唯一标识码',
  `qq_openid` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'QQ互联中，获取的Access Token，得到对应用户身份的OpenID,OpenID是此网站上或应用中唯一对应用户身份的标识，网站或应用可将此ID进行存储，便于用户下次登录时辨识其身份，或将其与用户在网站上或应用中的原有账号进行绑定。  用户的ID，与QQ号码一一对应。',
  `head_image` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户主页图片地址-默认值为默认图片的地址',
  `username` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户名(唯一而且不能有中文)-用户可以在注册后修改，修改一次90U币',
  `signature` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '个性签名',
  `password` varchar(32) NOT NULL COMMENT '密码(使用MD5+盐加密)',
  `salt` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '盐(密码加密时使用)',
  `mobile_phone` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机号 ',
  `sex` tinyint(4) NOT NULL DEFAULT '0' COMMENT '性别(默认为0)0-保密 1-男 2-女',
  `birthday` date DEFAULT NULL COMMENT '出生日期(默认为NULL)',
  `email` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '邮箱 ',
  `weixin` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '微信号',
  `qq` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'qq号',
  `mailbox_state` tinyint(4) DEFAULT NULL COMMENT '邮箱激活状态 1-激活0-未激活   ',
  `ub` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '当前账户可用U币(默认为0)',
  `alipay_account_number` varchar(100) DEFAULT NULL COMMENT '支付宝账号(默认为NULL)',
  `alipay_real_name` varchar(100) DEFAULT NULL COMMENT '支付宝真实姓名(默认为NULL)',
  `real_name_state` tinyint(4) DEFAULT NULL COMMENT '实名认证状态 0-未实名认证 1-审核中 2-实名认证通过 3-实名认证失败',
  `description` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '描述',
  `update_id` int(11) NOT NULL DEFAULT '0' COMMENT '修改人的id',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '用户类型 0-用户 1-管理员 - 默认为0-也就是用户',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '用户状态(默认为1)1-正常 0-被封号',
  `create_id` int(11) NOT NULL DEFAULT '0' COMMENT '创建者id',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `delete_time` int(11) NOT NULL DEFAULT '0' COMMENT '删除时间，0-未删除，其他值表示删除的时间点，单位秒',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `uniq_email` (`email`) USING BTREE,
  UNIQUE KEY `uniq_username` (`username`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of users
-- ----------------------------
BEGIN;
COMMIT;

