  `good_id` int(11) NOT NULL COMMENT '商品的id-如果是兑换的虚拟物品，就是具体虚拟物品id，兑换的资源，就是具体资源的id',
  `state` tinyint(1) NOT NULL COMMENT '兑换状态:0-兑换失败 1-发货中   2-交易成功',
  `buy_number` int(11) NOT NULL COMMENT '购买物品的数量',
  `order_number` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单编号,格式为当前年月日时分秒毫秒+随机生成10位数字，如："20170228155316339*****"',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `delete_time` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `fk_user_expense_ub_user_id` (`user_id`),
  KEY `fk_user_expense_ub_expense_type_id` (`expense_type_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户消费Ub订单表';

