-- ----------------------------
-- Table structure for users_pay
-- ----------------------------
DROP TABLE IF EXISTS `users_pay`;
CREATE TABLE `users_pay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `money` decimal(11,2) NOT NULL COMMENT '金额',
  `info` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '留言',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `email` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '通知邮箱',
  `state` tinyint(4) NOT NULL DEFAULT '0' COMMENT '显示状态 0待审核 1通过 2驳回 3已扫码',
  `pay_type_en_name` varchar(64) NOT NULL COMMENT 'pay_type的en_name，支付类型',
  `pay_num` varchar(128) NOT NULL DEFAULT '' COMMENT '支付标识',
  `custom` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否自定义输入，0否',
  `mobile` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否移动端，0否',
  `device` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '用户支付设备信息',
  `token_num` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '生成二维码编号标识token',
  `pass_url` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '通过审核的url',
  `back_url` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '操作后的url',
  `close_url` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '关闭交易的url',
  `delete_time` int(11) NOT NULL DEFAULT '0',
  `order_number` varchar(32) NOT NULL COMMENT '订单号',
  `users_id` int(11) NOT NULL COMMENT '用户id',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uniq_order_number` (`order_number`) USING BTREE,
  KEY `fk_users_id` (`users_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='用户支付信息详情表';

